import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes, NavLink, useNavigate } from 'react-router-dom';
import Header from './../components/Header';
import Footer from './../components/Footer';
import './../starterstyles.css';
import SampleShare from './SampleShare';
import SampleCreateEdit from './SampleCreateEdit';

const baseURL = 'https://comp2140.uqcloud.net/api/';

const APIKEY = 'gdJY8BdnNf';

const url = `${baseURL}sample/?api_key=${APIKEY}`;

function SampleList () {

    const navigate = useNavigate();

    const [sample, setSample] = useState(null);

    const navToCreate = () => {
        navigate('/WebCreate', {replace: true});
    };

    const navToShare = () => {
        navigate('/WebShare', {replace: true});
    };


    useEffect(() => {
        const fetchSample = async () => {
            try {
                const APIResponse = await fetch(url);
                const json = await APIResponse.json();
                setSample(json);
            } catch (error) {
                // error handling
                console.log("error", error);
            }
        }

        // call the async fetchSample function
        fetchSample();
    }, [])

    return (
        <>

        <h2 className="title">Your Song Samples</h2>

                <div className="create-card">
                    <nav>
                    <NavLink to="/SampleCreateEdit" className="bright-button">Create Sample</NavLink>
                    </nav>
                </div>

                <section className="sample">
                    <div className="card">
                        <div className="song-details">
                            <h3>Song Name</h3>
                            <p>Date Created</p>
                        </div>
                        <div class="button-group-container">
                            <button onClick={navToShare} className="button">Share</button>
                            <button className="button">Preview</button>
                            <button onClick={navToCreate} className="bright-button">Edit</button>
                        </div>
                    </div>
                </section>

                <Routes>
                    <Route path="/" element={<SampleList />} />
                    <Route path="/SampleCreateEdit" element={<SampleCreateEdit />} />
                    <Route path="/SampleShare" element={<SampleShare />} />
                </Routes>

                <div className="create-card">
                <nav>
                    <NavLink to="/SampleCreateEdit" className="bright-button">Create Sample</NavLink>
                    </nav>
                </div>

        </>
    );
}

export default SampleList;
